('Algorithms and Complexity', 'MTech', 1, 'Programme Core (PC)', '04 (3-0-2)', 'Algorithmic paradigms: Dynamic Programming, Greedy, Branch-and-bound, Asymptotic complexity, Amortized analysis, Graph Algorithms: Shortest paths, Flow networks; NP-completeness, Approximation algorithms, Randomized algorithms and advanced data structures.', '1.T.H. Cormen, C.E. Leiserson, R.L. Rivest, ', 'Computer Science and Engineering'),
('Computer Organisation And Architecture', 'BTech', 3, 'Programme Core (PC)', '04 (3-1-0)', 'Logical organization of computers; Processor basics, CPU organization, Data Representation, Instruction Sets, Data path design, Fixed Point arithmetic, ALU design, Control design: Basic concepts, Micro programmed Control & hardwired; Introduction to parallel processing: Principles of pipeline and vector processing. Multiprocessor architectures and programming.', '', 'Computer Science and Engineering'),
('Computer Programming', 'BTech', 1, 'Engineering Core', '04 (3-1-0)', 'Concepts, definitions, taxonomy and history of Computer Programming, Operating systems and Program Execution basics. Problem solving and programming: strategies, programming paradigms,software development life cycle. C programming language: C fundamentals, operators and expressions, Data input and output, Control statements, Functions, Arrays, Pointers, Dynamic memory allocations, Structure and unions, Files, Low- level Programming and Macros.', '', 'Computer Science and Engineering'),
('Computer Programming Lab', 'BTech', 1, 'Engineering Science Core (ESC)', '01 (0-0-2)', 'Introduction to fundamentals of DOS and Windows, C Programming exercise on simple statements, Control structures, Arrays, Matrices, Strings, Functions and Recursions, Structures and Unions, Bit Operations, Pointers, Dynamic Memory allocation, Files and Macros.', 'boolea', 'Computer Science and Engineering'),
('Database Engineering', 'MTech', 2, 'Programme Core (PC)', '04 (3-0-2)', 'Distributed Databases: principles, Architecture, Design, Query Optimization, Transaction Processing, Concurrency control, Integrity and Security, Client/server architecture, Parallel Databases, Web databases, Current trends in database systems.', '1.M.TamerÖzsu, ', 'Computer Science and Engineering'),
('Design Of Digital Systems', 'BTech', 3, 'Programme Core (PC)', '04 (3-1-0)', 'Switching algebra and logic circuits; combinational and sequential circuits and their algorithmic synthesis; Computer aided synthesis and optimization (introduction); Hardware modeling using VHDL; Logic optimization: two level, multi level, circuits; Introduction to VLSI design: MOS devices, system level design; Introduction to VLSI testing: fault models, testing combination and sequential circuits.', '1. Alan B.Marcovitz, ', 'Computer Science and Engineering'),
('High Performance Computing', 'MTech', 1, 'Programme Core (PC)', '04 (3-0-2)', 'Overview and history of computing. Architectural Classification schemes, High performance computing, overview and performance quantification criteria, limits on performance Design of high performance architecture, parallel vs. pipeline architectures. Pipeline processing, Theory of pipeline scheduling and implementation, Hazards in Pipeline processors, Hazard detection and resolution techniques, Static and dynamic schedules, Evolution of RISC ISAs and pipeline hazards, Interconnection Networks, Topics of current research in High performance computing.', '1.K. Hwang and F. A. Briggs, ', 'Computer Science and Engineering'),
('Information Systems', 'BTech', 4, 'Programme Specific Electives (PSE)', ' 03 (3-0-0)', 'Information System Design and Development - phases; System analysis methods - Data, Process, Network and Object modeling; System design approaches / methods - architectures and processes, input and output, prototyping; system implementation, safety & security, maintenance.', '', 'Computer Science and Engineering'),
('Network Engineering', 'MTech', 3, 'Programme Core (PC)', '04 (3-0-2)', 'Internetworking: Architectural principle, layering, names and addresses, Advanced topics in Transport Protocol, Congestion Control, Fair Queuing, Router design and router protocols. Network topologies, Peer-to-Peer networks, Application level protocols, Network management and access control.', '1.Larry L. Peterson, Bruce S. Davie, ', 'Computer Science and Engineering'),
('Unix Network Programming', 'BTech', 2, 'Programme Core', '3 (0-0-3)', 'Introduction to Unix / Linux Operating System;. Basic commands- such as cp, mv, mkdir, rm, ls, ln, grep, wc, find, sed, awk. Usage of gcc and gdb. Basic system administration skills. Usage of the vi editor. Shell programming. Installation of the Linux Operating System and precautions to be taken. Basics of Kernal modules. Introduction to Linux device drivers. MAKE Files.', '1. Brian W.Kernighan, ', 'Computer Science and Engineering');

