INSERT INTO `program_table` (`program_id`, `program_name`, `program_desp`, `program_outcome`, `program_objective`) VALUES
(1, 'BTech', 'The B.Tech in Computer Science and Engineering is one of the most popular programmes at N.I.T.K Surathkal. The programme was stated in 1986 and has been designed to cater to global demands and offers a balanced coverage of hardware and software systems. The programme includes elective courses covering thrust areas such as Distributed Systems & Computing, Parallel Architectures & High performance computing, High-Speed Networks, Designing with Network Processors, Security and Embedded Systems Cloud Computing etc. The B.Tech. programme enjoys an enviable placement of almost 100% year after year. About 25 to 35% of the students pursue higher studies after their graduation, mostly in U.S with scholarship and even without fellowship. <br><br>Average Intake (per year) :110<br><br>Admission : Through JEE(Main) as per guidelines of MHRD', '<ul><li>Ability to apply knowledge of computing, mathematics, science and engineering fundamentals to the solution of complex engineering problems.</li><li>Ability to formulate and analyze a problem, and define the computing requirements appropriate to its solution using basic principles of mathematics, science and computer engineering.</li><li>Ability to design, implement, and evaluate a computer based system, process, component, or software to meet the desired needs.</li><li>Ability to design and conduct research based experiments, perform analysis and interpretation of data and provide valid conclusions.</li><li> Ability to use current techniques, skills, and tools necessary for computing practice.</li><li>Understanding of legal, health, security, cultural and social issues, and the consequent responsibilities relevant to the professional engineering practice.</li><li> Understanding of the impact of professional engineering solutions on environmental context and the need for sustainable development.</li><li>Understanding and commitment towards the professional and ethical responsibilities of an engineer.</li><li>Ability to function effectively as an individual, and as a team member / leader in accomplishing a common goal.</li><li>Ability to communicate effectively, make effective presentations and write and comprehend technical reports and publications.</li><li>Ability to learn and adopt new technologies, and use them effectively towards continued professional development throughout the life.</li><li>Understanding of engineering and management principles and their application to manage projects in the software industry.</li></ul>', '<ul><li>To provide students with sound foundations in Basic Sciences and fundamentals in Engineering Sciences.</li><li>To inculcate strong problem solving skills through the courses of CSE.</li><li>To provide students with hands on experience in implementing various software development concepts.</li><li>Train the students in project based assignments.</li><li> To impress upon students the importance of good ethical practices, right professional conduct and responsible team leadership.</li></ul>'),
(2, 'MTech', 'The department offers two post-graduate courses - M.Tech. in Computer Science and Engineering (CSE) and M.Tech in Computer Science and Engineering - Information Security (CSE-IS).\r\n<br><br>\r\nAdmission through GATE -  as per guidelines of MHRD', '<ul>\r\n<li>Apply knowledge of mathematics and principles of computing in the design and development of software and hardware systems of varying complexity.</li>\r\n<li>Enhance skills and continuously acquire advanced knowledge in Computer Science, multidisciplinary and interdisciplinary domains for professional excellence.</li>\r\n<li>Identify, formulate and critically study the problem, design and develop efficient algorithms, conduct experiments, analysing the results and  applying the knowledge to different domains.</li>\r\n<li>Apply current techniques, skills and modern engineering tools to build robust, reliable, maintainable, scalable and efficient computing systems  by considering social, environmental, economic, and security constraints.</li>\r\n<li>Critically analyze existing literature in an area of specialization, conduct investigative research to develop innovative methodologies to tackle  issues identified and contribute to the development of technological knowledge and intellectual property.</li>\r\n<li>Manage and execute complex engineering projects under economic, time and performance constraints.</li>\r\n<li>Contribute and communicate effectively in multidisciplinary and multicultural scenarios.</li>\r\n<li>Become a complete professional with high integrity and ethics, with excellent professional conduct and with empathy towards the environmental and social needs.</li>\r\n<li>Critically evaluate the outcomes of one\'s actions and apply self corrective measures to improve the performance.</li>\r\n</ul>', '<ul>\r\n<li>Analyze, design and create computing solutions for scientific and multidisciplinary engineering challenges.</li>\r\n<li>Pursue a successful career in industry/academia/research/government driven by strong foundations and in-depth domain knowledge and  contribute to the engineering sphere as a competent professional.</li>\r\n<li>Demonstrate an exceptional involvement and active participation in Research and Development leading to new innovations and optimized solutions.</li>\r\n<li>Engage in lifelong learning with persistent scientific temper for professional advancement and effective communication of the technical information.</li>\r\n<li>Work effectively in multi-disciplinary and multi-cultural environments by respecting professionalism and ethical practices within organization and society at national and international level.</li>\r\n</ul>');

